selector_to_html = {"a[href=\"#journal-articles\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Journal articles<a class=\"headerlink\" href=\"#journal-articles\" title=\"Permalink to this heading\">#</a></h2><p>Advertisements on multiple pages in an issue grouped as a single work record for discovery: <a class=\"reference external\" href=\"https://trove.nla.gov.au/work/232859472?keyword=fullTextInd%3Ay\">https://trove.nla.gov.au/work/232859472?keyword=fullTextInd%3Ay</a></p><p>Can access as separate versions via the API: <a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fwork%2F232859472%3Fencoding%3Djson%26include%3Dall&amp;amp;comment=\">https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fwork%2F232859472%3Fencoding%3Djson%26include%3Dall&amp;comment=</a></p>", "a[href=\"#finding-nla-digitised-content-you-can-download\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Finding NLA digitised content you can download<a class=\"headerlink\" href=\"#finding-nla-digitised-content-you-can-download\" title=\"Permalink to this heading\">#</a></h1><p>Trove provides a platform for the delivery of digitised content from the National Library of Australia and its partners. This digitised content is easy to find in the <em>Newspapers &amp; gazettes</em> and <em>Magazines &amp; newsletters</em> categories \u2013 they\u2019re full of it! But it\u2019s not so easy to find digitised content in other categories where it\u2019s mixed with works aggregated from a range of different sources.</p><p>There are a few different approaches to finding digitised content. They all have potential problems, so it\u2019s a matter of working out what will best meet your research needs.</p>", "a[href=\"#advanced-search-orgs\"]": "<figure class=\"align-default\" id=\"advanced-search-orgs\">\n<a class=\"reference internal image-reference\" href=\"../_images/advanced_search_orgs.png\"><img alt=\"../_images/advanced_search_orgs.png\" src=\"../_images/advanced_search_orgs.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Selecting \u2018Trove Digital Library\u2019 in the Advanced Search form \u2013 note the NUC identifier in brackets</span><a class=\"headerlink\" href=\"#advanced-search-orgs\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#limit-results-to-the-trove-digital-library\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Limit results to the \u2018Trove Digital Library\u2019<a class=\"headerlink\" href=\"#limit-results-to-the-trove-digital-library\" title=\"Permalink to this heading\">#</a></h2><p>In the Advanced Search form for the <em>Books &amp; Libraries</em>, <em>Research &amp; Reports</em>, <em>Images, Maps &amp; Artefacts</em>, <em>Diaries, Letters &amp; Archives</em>, and <em>Music, Audio &amp; Video</em> categories, there\u2019s an option to limit the source of the records in your results by selecting from a list of \u2018Organisations\u2019. Hidden away in this list is the \u2018Trove Digital Library\u2019. Unfortunately, selecting \u2018Trove Digital Library\u2019 in Advanced Search doesn\u2019t work at the moment because of a bug in the web interface, but once you know it exists you can manually add it to your searches.</p>", "a[href=\"#search-for-records-including-nla-obj\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Search for records including <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code><a class=\"headerlink\" href=\"#search-for-records-including-nla-obj\" title=\"Permalink to this heading\">#</a></h2><p>All of the digitised resources in Trove (except for <em>Newspapers &amp; Gazettes</em>) have NLA identifiers of the form <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj-[NUMBER]</span></code>. So a search for <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> should return all digitised resources.</p>", "a[href=\"#other-options\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Other options<a class=\"headerlink\" href=\"#other-options\" title=\"Permalink to this heading\">#</a></h2><p>There are a couple of other search indexes that can help identify digitised content:</p>", "a[href=\"#finding-digitised-content\"]": "<table class=\"table\" id=\"finding-digitised-content\">\n<caption><span class=\"caption-text\">Finding digitised content</span><a class=\"headerlink\" href=\"#finding-digitised-content\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Category</p></th>\n<th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Results</p></th>\n<th class=\"head\"><p>Notes</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>book</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/books?keyword=fullTextInd%3Ay\"><code class=\"docutils literal notranslate\"><span class=\"pre\">fullTextInd:y</span></code></a></p></td>\n<td><p>2,804,463</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>book</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/books?keyword=has%3Acorrectabletext\"><code class=\"docutils literal notranslate\"><span class=\"pre\">has:correctabletext</span></code></a></p></td>\n<td><p>41,189</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>book</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/books?keyword=%22nla.obj%22\"><code class=\"docutils literal notranslate\"><span class=\"pre\">\"nla.obj\"</span></code></a></p></td>\n<td><p>603,141</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>book</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/books?keyword=fullTextInd%3Ay%20AND%20has%3Acorrectabletext\"><code class=\"docutils literal notranslate\"><span class=\"pre\">fullTextInd:y</span> <span class=\"pre\">AND</span> <span class=\"pre\">has:correctabletext</span></code></a></p></td>\n<td><p>27,161</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>image</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/images?keyword=fullTextInd%3Ay\"><code class=\"docutils literal notranslate\"><span class=\"pre\">fullTextInd:y</span></code></a></p></td>\n<td><p>75,950</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>image</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/images?keyword=has%3Acorrectabletext\"><code class=\"docutils literal notranslate\"><span class=\"pre\">has:correctabletext</span></code></a></p></td>\n<td><p>100</p></td>\n<td></td>\n</tr>\n<tr class=\"row-even\"><td><p>image</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/images?keyword=%22nla.obj%22\"><code class=\"docutils literal notranslate\"><span class=\"pre\">\"nla.obj\"</span></code></a></p></td>\n<td><p>281,890</p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p>image</p></td>\n<td><p><a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/images?keyword=%22nla.obj%22&amp;l-availability=y\"><code class=\"docutils literal notranslate\"><span class=\"pre\">\"nla.obj\"</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">l-availability=y</span></code></a></p></td>\n<td><p>247,356</p></td>\n<td></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#fulltextind-y\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">fullTextInd:y</span></code><a class=\"headerlink\" href=\"#fulltextind-y\" title=\"Permalink to this heading\">#</a></h2><p>The API Version 2.1 introduction noted that this index allowed you to:</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
